const UserData = ({users}) => {
    return (
        <>
            {
                users.map((curUser,index) => {
                    const {name, ticker, avg_price,market_price,market_value_ccy,latest_chg_pct} = curUser;

                    return (
                        <tr key={index}>
                            <td>{name}</td>
                            <td>{ticker}</td>
                            <td>{avg_price}</td>
                            <td>{curUser.market_price}</td>
                            <td>{curUser.market_value_ccy}</td>
                            <td>{curUser.latest_chg_pct}</td>
                        </tr>
                    )
                })

            }
        </>
    )
}
export default UserData;
